import React,{ useState } from 'react';
import {Form, Button,} from 'react-bootstrap';
import {useHistory}  from 'react-router-dom';
import Modal from 'react-modal';
import './style.css';

function InfoModal() {
    const [infoIsOpen,setInfoIsOpen] = useState(false)
    return (
    <div className="Info">
        <Button className="InfoBtn" onClick={()=> setInfoIsOpen(true)}>Each Button Functions</Button>

       <div className="InfoWrapper">
        <Modal isOpen={infoIsOpen} onRequestClose ={()=> setInfoIsOpen(false)}>
        <div className="Clooosebtn">
						<Button className="closeBtn" onClick={() => setInfoIsOpen(false)}>
							X
						</Button>
					</div>
                   <h1 className="InfoTitleMod">Each button</h1>

                   <div className="etextInfoWrap">
                     <p className="InfoEText">
                     You do not feel comfortable, safe or valued with the person you are with? <br/>
                     Or are you just very bored and want to get out of the situation? <br/>
                     We alert YOUR SISTERS, if a sister is near, she will go or contact<br/>
                      you and will help you to get out of that uncomfortable moment!<br/>
                      WE GOT YOU GIRL!
                     </p>
                  </div>

      </Modal>
      </div> 
    </div>
  );
}

export default InfoModal;
